import './NewExpense.css';
import React, { useState } from 'react';
import ExpenseForm from './ExpenseForm';

let condicao = true;

const NewExpense = (props) => {
    return <div className="new-expense">{condicao ? <button className="new-expense__button">ADD A EXPENSE</button> : <ExpenseForm onSaveExpenseData={props.onSaveExpenseData} />}</div>;
};

export default NewExpense;
